import React from 'react';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Main from './component/Main';

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" component={Main} />
      </Routes>
    </Router>
  )
}
